id = "PAV060"
question = "Vad är syftet med Tidskrift för matematik och fysik?"
answer = "Tidskrift för matematik och fysik , tillegnad den svenska elementarundervisningen, har tili sin uppgift att hos den studerande ungdomen vid Universitäten, de militāra och tekniska skolorna samt elementarläroverken lifva intresset för de matematiska och fysiska vetenskaperna och att derigenom tili allt vidare kretsar utbreda studiet af desamma"
difficulty = "Medium"
category = "Physics"
