id = "PAV099"
question = "Vad är det övergripande syftet med avhandlingen?"
answer = "Avhandlingens övergripande syfte är att bidra med kunskap om ämneslitteracitet i två skolämnen, svenska som andraspråk och fysik, och om hur ämneslitteracitet tar sig uttryck i en undervisningskontext där två lärare samarbetar och majoriteten av eleverna lär sig skolans ämnen på ett andraspråk"
