question = "Vad anser Allen och Martin om användning av frågor i undervisningen?"
answer = "Allen (2002) menar att frågor utmanar elevernas tänkande, vilket leder till att de drar egna slutsatser och kan därför spela en stor roll för att eleverna utvecklas intellektuellt"
